import React from 'react';
import {Link} from 'react-router-dom';

function Home() {
  return (
    <div>
        <div className="card">
            <div className="card-header">
                Dr. ABC
            </div>
            <div className="card-body">
                <h5 class="card-title">Surgeon</h5>
                <Link to='/schedule'>
                    <button className="btn btn-danger">Book Appointment</button>
                </Link>
            </div>
        </div><br />


    </div>
  );
}


export default Home;
